import React, { Component } from "react";
import axios from "axios";

class Test extends Component {
  state = {
    url_photo: "",
    url_video: "",
    project_info: "",
    project_title: "",
  };

  getinfo = () => {
    axios.get("http://localhost:5000/info/").then((res) => console.log(res));
  };

  render() {
    return (
      <React.Fragment>
        {this.getinfo()}
        <form>
          <div class="form-group">
            <label for="exampleFormControlInput1" style={{ color: "white" }}>
              url_photo
            </label>
            <input
              type="email"
              class="form-control"
              id="url_photo"
              placeholder="name@example.com"
            />
          </div>
          <div class="form-group">
            <label for="exampleFormControlSelect1" style={{ color: "white" }}>
              Example select
            </label>
            <input
              type="email"
              class="form-control"
              id="url_video"
              placeholder="name@example.com"
            />
          </div>

          <div class="form-group">
            <label for="exampleFormControlTextarea1" style={{ color: "white" }}>
              Project info
            </label>
            <textarea
              class="form-control"
              id="exampleFormControlTextarea1"
              rows="3"
            ></textarea>
          </div>
        </form>
      </React.Fragment>
    );
  }
}

export default Test;
